import s from './profile.module.css'

const ProfilePage = () =>{
  return (
    <div className={s.profile}>
      <div>Photo</div>
      <div>Links</div>
      <div>Comments</div>
      <div>Friendlist</div>
    </div>
  );
}

export default ProfilePage;
